PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "Items" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "loan_count" integer NOT NULL, "price" decimal NOT NULL, "description" text NULL, "in_stock" bool NOT NULL, "image" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "Payment_methods" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(30) NOT NULL, "description" text NOT NULL, "icon" varchar(100) NULL, "active" bool NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "Users_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" bigint NOT NULL REFERENCES "Users" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Users_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" bigint NOT NULL REFERENCES "Users" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Savings_Items" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "target_amount" decimal NOT NULL, "amount_saved" decimal NOT NULL, "start_date" date NOT NULL, "due_date" date NULL, "achieved" bool NOT NULL, "in_progress" bool NOT NULL, "saving_period" integer NOT NULL, "is_suspended" bool NOT NULL, "item_id" bigint NOT NULL REFERENCES "Items" ("id") DEFERRABLE INITIALLY DEFERRED, "savings_id" bigint NOT NULL REFERENCES "Savings_Accounts" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Savings_Accounts" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "amount_saved" decimal NOT NULL, "start_date" date NOT NULL, "is_active" bool NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "user_id" bigint NOT NULL UNIQUE REFERENCES "Users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "savings_transactions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "type" varchar(25) NOT NULL, "amount" decimal NOT NULL, "timestamp" datetime NOT NULL, "payment_method_id" bigint NULL REFERENCES "Payment_methods" ("id") DEFERRABLE INITIALLY DEFERRED, "savings_item_id" bigint NOT NULL REFERENCES "Savings_Items" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "TrustScore" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "score" integer NOT NULL, "is_blacklisted" bool NOT NULL, "comment" text NULL, "timestamp" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "Users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "Users" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" bigint NOT NULL UNIQUE REFERENCES "Users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Users" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "phonenumber" varchar(15) NULL, "idnumber" varchar(20) NULL UNIQUE, "email" varchar(254) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "loan_limit" decimal NOT NULL, "interest_rate" decimal NOT NULL, "loan_owed" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "Loans" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "amount" decimal NOT NULL, "purpose" text NULL, "interest_rate" decimal NOT NULL, "loan_duration" integer NOT NULL, "application_date" date NOT NULL, "due_date" date NULL, "repaid_amount" decimal NOT NULL, "is_approved" bool NOT NULL, "is_active" bool NOT NULL, "disbursed" bool NOT NULL, "grace_period" integer NOT NULL, "grace_period_end_date" date NULL, "late_payment_penalty_rate" decimal NOT NULL, "collateral" varchar(100) NULL, "amount_disbursed" decimal NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "Users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Loan_Repayments" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "amount_paid" decimal NOT NULL, "payment_date" datetime NULL, "loan_id" bigint NOT NULL REFERENCES "Loans" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Loan_Transactions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "type" varchar(20) NOT NULL, "amount" decimal NOT NULL, "description" text NULL, "timestamp" datetime NOT NULL, "is_successful" bool NOT NULL, "loan_id" bigint NULL REFERENCES "Loans" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "Users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
